window.bookSummaryJSON = "<p>Dashiell Thane wasn’t a nice guy. He was an abrasive, demanding, conniving, intolerable brat. Yet somehow, we’d been best friends our whole lives - until our senior year when I finally decided to dip my toes into the dating pool. </p> <p>All it took was one kiss for jealousy, lies, and betrayal to sweep in and propel us heart first into dizzying, hostile depths. </p> <p>You’re not supposed to kiss your best friend. You’re definitely not supposed to kiss your best friend while you’re dating someone else. And the absolute worst thing you could do is fall for your best friend. Unless, of course, you want to ruin everything.</p>"; 
